function myFunction1() {
  var a = document.getElementById('step-one')
  var b = document.getElementById('step-two')
  var c = document.getElementById('step-three')
  var d = document.getElementById('step-four')
  var e = document.getElementById('step-five')
  var f=document.getElementById('step-six')
  var g=document.getElementById('step-seven')
  //var h=document.getElementById('step-eight')
  if (a.style.display === 'none') {
    a.style.display = 'block'
    b.style.display = 'none'
    c.style.display = 'none'
    d.style.display = 'none'
    e.style.display = 'none'
    b.style.display = 'none'
    f.style.display='none'
    g.style.display='none'
    //h.style.display='none'
  } else {
    a.style.display = 'none'
  }
}

